INSERT INTO `media_info` (`id`, `create_time`, `update_time`, `media_type_enum`, `url`, `image_url`, `image_base64`, `name`, `year`, `publish_date`, `country`, `language`, `length`, `dou_ban_score`, `dou_ban_top250_no`, `other_name`, `imdb_id`, `episodes`, `description`) VALUES
	(3, '2023-01-30 14:58:34', '2023-01-30 14:58:34', 'MOVIE', '/subject/1292052/', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p480747492.jpg', '', '肖申克的救赎 The Shawshank Redemption', 1994, '1994-09-10', '美国', '英语', 142, 9.7, 'No.1', '月黑高飞(港) / 刺激1995(台) / 地狱诺言 / 铁窗岁月 / 消香克的救赎', 'tt0111161', NULL, '一场谋杀案使银行家安迪（蒂姆•罗宾斯TimRobbins饰）蒙冤入狱，谋杀妻子及其情人的指控将囚禁他终生。在肖申克监狱的首次现身就让监狱“大哥”瑞德（摩根•弗里曼MorganFreeman饰）对他另眼相看。瑞德帮助他搞到一把石锤和一幅女明星海报，两人渐成患难之交。很快，安迪在监狱里大显其才，担当监狱图书管理员，并利用自己的金融知识帮助监狱官避税，引起了典狱长的注意，被招致麾下帮助典狱长洗黑钱。偶然一次，他得知一名新入狱的小偷能够作证帮他洗脱谋杀罪。燃起一丝希望的安迪找到了典狱长，希望他能帮自己翻案。阴险伪善的狱长假装答应安迪，背后却派人杀死小偷，让他唯一能合法出狱的希望泯灭。沮丧的安迪并没有绝望，在一个电闪雷鸣的风雨夜，一场暗藏几十年的越狱计划让他自我救赎，重获自由！老朋友瑞德在他的鼓舞和帮助下，也勇敢地奔向自由。\n\n本片获得1995年奥斯卡10项提名，以及金球奖、土星奖等多项提名。'),
	(4, '2023-01-30 14:59:45', '2023-01-30 14:59:45', 'MOVIE', '/subject/1291546/', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2561716440.jpg', '', '霸王别姬', 1993, '1993-01-01', '中国大陆 / 中国香港', '汉语普通话', 171, 9.6, 'No.2', '再见，我的妾 / Farewell My Concubine / Adieu Ma Concubine', 'tt0106332', NULL, '段小楼（张丰毅）与程蝶衣（张国荣）是一对打小一起长大的师兄弟，两人一个演生，一个饰旦，一向配合天衣无缝，尤其一出《霸王别姬》，更是誉满京城，为此，两人约定合演一辈子《霸王别姬》。但两人对戏剧与人生关系的理解有本质不同，段小楼深知戏非人生，程蝶衣则是人戏不分。\n段小楼在认为该成家立业之时迎娶了名妓菊仙（巩俐），致使程蝶衣认定菊仙是可耻的第三者，使段小楼做了叛徒，自此，三人围绕一出《霸王别姬》生出的爱恨情仇战开始随着时代风云的变迁不断升级，终酿成悲剧。'),
	(5, '2023-01-30 15:01:20', '2023-01-30 15:04:55', 'MOVIE', '/subject/1292720/', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2372307693.jpg', '', '阿甘正传 Forrest Gump', 1994, '1994-06-23', '美国', '英语', 142, 9.5, 'No.3', '福雷斯特·冈普', 'tt0109830', NULL, '阿甘（汤姆·汉克斯饰）于二战结束后不久出生在美国南方阿拉巴马州一个闭塞的小镇，他先天弱智，智商只有75，然而他的妈妈是一个性格坚强的女性，她常常鼓励阿甘“傻人有傻福”，要他自强不息。\n阿甘像普通孩子一样上学，并且认识了一生的朋友和至爱珍妮（罗宾·莱特·潘饰），在珍妮和妈妈的爱护下，阿甘凭着上帝赐予的“飞毛腿”开始了一生不停的奔跑。\n阿甘成为橄榄球巨星、越战英雄、乒乓球外交使者、亿万富翁，但是，他始终忘不了珍妮，几次匆匆的相聚和离别，更是加深了阿甘的思念。\n有一天，阿甘收到珍妮的信，他们终于又要见面……'),
	(6, '2023-01-30 15:05:38', '2023-01-30 15:05:38', 'MOVIE', '/subject/3742360/', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p1512562287.jpg', '', '让子弹飞', 2010, '2010-12-16', '中国大陆 / 中国香港', '汉语普通话 / 四川话 / 山西话', 132, 9, 'No.44', '让子弹飞一会儿 / 火烧云 / Let The Bullets Fly', 'tt1533117', NULL, '民国年间，花钱捐得县长的马邦德（葛优饰）携妻（刘嘉玲饰）及随从走马上任。途经南国某地，遭劫匪张麻子（姜文饰）一伙伏击，随从尽死，只夫妻二人侥幸活命。马为保命，谎称自己是县长的汤师爷。为汤师爷许下的财富所动，张麻子摇身一变化身县长，带着手下赶赴鹅城上任。有道是天高皇帝远，鹅城地处偏僻，一方霸主黄四郎（周润发饰）只手遮天，全然不将这个新来的县长放在眼里。张麻子痛打了黄的武教头（姜武饰），黄则设计害死张的义子小六（张默饰）。原本只想赚钱的马邦德，怎么也想不到竟会被卷入这场土匪和恶霸的角力之中。鹅城上空愁云密布，血雨腥风在所难免……\n本片根据马识途的小说《夜谭十记》中的《盗官记》一章改编。'),
	(7, '2023-01-30 15:06:40', '2023-01-30 15:06:40', 'MOVIE', '/subject/25964071/', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2264377763.jpg', '', '夏洛特烦恼', 2015, '2015-09-30', '中国大陆', '汉语普通话', 104, 7.8, NULL, 'Goodbye Mr. Loser', 'tt5061814', NULL, '在学生时代的初恋秋雅（王智饰）的婚礼上，毕业后吃软饭靠老婆养的夏洛（沈腾饰）假充大款，出尽其丑，中间还被老婆马冬梅（马丽饰）戳穿暴捶。混乱之中，夏洛意外穿越时空，回到了1997年的学生时代的课堂里。他懵懵懂懂，以为是场真实感极强的梦，于是痛揍王老师，强吻秋雅，还尝试跳楼让自己醒来。当受伤的他从病床上苏醒时，他意识到自己真的穿越了时空。既然有机会重新来过，那不如好好折腾一回。他勇敢追求秋雅、奚落优等生袁华（尹正饰）、拒绝马冬梅的死缠烂打。后来夏洛凭借“创作”朴树、窦唯等人的成名曲而进入娱乐圈。\n他的人生发生翻天覆地的巨变，但是内心某个地方却越来越感到空虚……'),
	(8, '2023-01-30 17:35:27', '2023-01-30 17:35:27', 'MOVIE', '/subject/1292722/', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p457760035.jpg', '', '泰坦尼克号 Titanic', 1997, '1997-11-01', '美国 / 墨西哥 / 澳大利亚 / 加拿大', '英语 / 意大利语 / 德语 / 俄语', 194, 9.5, 'No.4', '铁达尼号(港/台)', 'tt0120338', NULL, '1912年4月10日，号称“世界工业史上的奇迹”的豪华客轮泰坦尼克号开始了自己的处女航，从英国的南安普顿出发驶往美国纽约。富家少女罗丝（凯特•温丝莱特）与母亲及未婚夫卡尔坐上了头等舱；另一边，放荡不羁的少年画家杰克（莱昂纳多·迪卡普里奥）也在码头的一场赌博中赢得了下等舱的船票。\n罗丝厌倦了上流社会虚伪的生活，不愿嫁给卡尔，打算投海自尽，被杰克救起。很快，美丽活泼的罗丝与英俊开朗的杰克相爱，杰克带罗丝参加下等舱的舞会、为她画像，二人的感情逐渐升温。\n1912年4月14日，星期天晚上，一个风平浪静的夜晚。泰坦尼克号撞上了冰山，“永不沉没的”泰坦尼克号面临沉船的命运，罗丝和杰克刚萌芽的爱情也将经历生死的考验。'),
	(9, '2023-01-30 17:40:59', '2023-01-30 17:40:59', 'MOVIE', '/subject/1295644/', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p511118051.jpg', '', '这个杀手不太冷 Léon', 1994, '1994-09-14', '法国 / 美国', '英语 / 意大利语 / 法语', 110, 9.4, 'No.5', '终极追杀令(台) / 杀手莱昂 / 杀手里昂 / Leon / Leon: The Professional', 'tt0110413', NULL, '里昂（让·雷诺饰）是名孤独的职业杀手，受人雇佣。一天，邻居家小姑娘马蒂尔达（纳塔丽·波特曼饰)敲开他的房门，要求在他那里暂避杀身之祸。原来邻居家的主人是警方缉毒组的眼线，只因贪污了一小包毒品而遭恶警（加里·奥德曼饰）杀害全家的惩罚。马蒂尔达得到里昂的留救，幸免于难，并留在里昂那里。里昂教小女孩使枪，她教里昂法文，两人关系日趋亲密，相处融洽。\n女孩想着去报仇，反倒被抓，里昂及时赶到，将女孩救回。混杂着哀怨情仇的正邪之战渐次升级，更大的冲突在所难免……'),
	(10, '2023-01-30 17:41:46', '2023-01-30 17:41:46', 'MOVIE', '/subject/1292063/', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2578474613.jpg', '', '美丽人生 La vita è bella', 1997, '1997-12-20', '意大利', '意大利语 / 德语 / 英语', 116, 9.6, 'No.6', '一个快乐的传说(港) / Life Is Beautiful', 'tt0118799', NULL, '犹太青年圭多（罗伯托·贝尼尼）邂逅美丽的女教师多拉（尼可莱塔·布拉斯基），他彬彬有礼的向多拉鞠躬：“早安！公主！”。历经诸多令人啼笑皆非的周折后，天遂人愿，两人幸福美满的生活在一起。\n然而好景不长，法西斯政权下，圭多和儿子被强行送往犹太人集中营。多拉虽没有犹太血统，毅然同行，与丈夫儿子分开关押在一个集中营里。聪明乐天的圭多哄骗儿子这只是一场游戏，奖品就是一辆大坦克，儿子快乐、天真的生活在纳粹的阴霾之中。尽管集中营的生活艰苦寂寞，圭多仍然带给他人很多快乐，他还趁机在纳粹的广播里问候妻子：“早安！公主！”\n法西斯政权即将倾覆，纳粹的集中营很快就要接受最后的清理，圭多编给儿子的游戏该怎么结束？他们一家能否平安的度过这黑暗的年代呢？'),
	(11, '2023-01-30 17:46:15', '2023-01-30 17:47:04', 'MOVIE', '/subject/1295124/', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p492406163.jpg', '', '辛德勒的名单 Schindler\'s List', 1993, '1993-11-30', '美国', '英语 / 希伯来语 / 德语 / 波兰语', 195, 9.6, 'No.8', '舒特拉的名单(港) / 辛德勒名单', 'tt0108052', NULL, '1939年，波兰在纳粹德国的统治下，党卫军对犹太人进行了隔离统治。德国商人奥斯卡·辛德勒（连姆·尼森LiamNeeson饰）来到德军统治下的克拉科夫，开设了一间搪瓷厂，生产军需用品。凭着出众的社交能力和大量的金钱，辛德勒和德军建立了良好的关系，他的工厂雇用犹太人工作，大发战争财。\n1943年，克拉科夫的犹太人遭到了惨绝人寰的大屠杀，辛德勒目睹这一切，受到了极大的震撼，他贿赂军官，让自己的工厂成为集中营的附属劳役营，在那些疯狂屠杀的日子里，他的工厂也成为了犹太人的避难所。\n1944年，德国战败前夕，屠杀犹太人的行动越发疯狂，辛德勒向德军军官开出了1200人的名单，倾家荡产买下了这些犹太人的生命。在那些暗无天日的岁月里，拯救一个人，就是拯救全世界。');
